        else {
            itr.forEach((x) => {
                if (fn(x))
                    chosen.push(x);
                else
                    unchosen.push(x);
            });
        }
        return { chosen, unchosen };
    }
    predicateForTail(left, right) {
        const limits = { min: this.includeValMin, max: this.includeValMax };
        if (limits.min && limits.max) {
            return function (x) {
                return x >= left && x <= right;
            };
        }
        else if (limits.min && !limits.max) {
            return function (x) {
                return x >= left && x < right;
            };
        }
        else if (!limits.min && limits.max) {
            return function (x) {
                return x > left && x <= right;
            };
        }
        else if (!limits.min && !limits.max) {
            return function (x) {
                return x > left && x < right;
            };
        }
        else
            return null;
    }
